// 过滤掉 preset 数据，并设置 preset
function filterPreset(params) {
  const { url, ...pureParams } = params;
  const { module, position } = pureParams;

  if (url) {
    preset(url, {
      module,
      position,
    });
  }

  return pureParams;
}

// 对外暴露的上报接口
function report(params = {}, immed) {
  if (params instanceof Object && !(params instanceof Array)) {
    const pureParams = filterPreset(params);
    const eventTime = new Date().valueOf(); // 当前时间戳
    const seq = createRandomId(); // 创建 seq 唯一标记
    const reportParams = {
      env: getFromValueFromEnv(),
      from_source: getFromValue(),
      ...REPORT_DATA,
      ...pureParams,
      event_time: eventTime,
      _seq: seq,
    };

    // 先保存到缓存
    reportStorage.set(seq, reportParams);

    if (immed) {
      // 立即上报
      immedReport(seq, reportParams);
    } else {
      // 合并上报
      mergeReport(reportParams);
    }
  } else {
    throw new Error("tdwReport's arguments must be an JSON Object!");
  }
}

// 删除超时的预设数据
function delExpirePreset() {
  const presetDatas = presetStorage.getAll();

  Object.keys(presetDatas).forEach(seq => {
    // 把超过 5 秒未上报的缓存数据清除
    if ((new Date().getTime() - presetDatas[seq].ctime) / 1000 > 5) {
      presetStorage.del(seq);
    }
  });
}

// 页面曝光上报
function reportExposePage() {
  report({
    event: 'pageview',
  });
}

// 上报曝光的 dom
function reportExposeDom(doms) {
  [...doms].forEach(dom => {
    if (dom && !dom.getAttribute('has-expose') && isVisible(dom)) {
      dom.setAttribute('has-expose', 1); // 标记已上报
      report({
        event: 'expose',
        module: dom.getAttribute(REPORT_DOM_ATTR),
      });
    }
  });
}

// 监听页面 onload
function onLoad(callback = () => {}) {
  if (document.readyState === 'complete') {
    callback();
  } else {
    addEvent(window, 'load', callback, false);
  }
}

// 页面曝光事件绑定
function bindExposePage() {
  onLoad(reportExposePage);
}

// 模块曝光事件绑定
function bindExposeDom(parentDom) {
  onLoad(() => {
    const watchDoms = document.querySelectorAll(REPROT_DOM_SELECTOR);
    const targetDom = parentDom || window;
    reportExposeDom(watchDoms);
    addEvent(
      targetDom,
      'scroll',
      () => {
        reportExposeDom(watchDoms);
      },
      false
    );
  });
}

// 事件绑定
function bindEvents() {
  bindExposePage();
  bindExposeDom();
}

// 给链接添加 share=1 标记
function addShareFlag(url = '') {
  if (url.indexOf('?') > -1) {
    url = url.replace('?', '?share=1&');
  } else if (url.indexOf('#') > -1) {
    url = url.replace('#', '?share=1#');
  } else {
    url += '?share=1';
  }

  return url;
}

// 每次初始化时检查并重置正在上报中的 seqs
function resetReporting() {
  const sendingSeqs = Object.keys(sendingStorage.getAll());
  const reportParams = reportStorage.getAll();

  if (sendingSeqs.length > 0) {
    sendingSeqs.forEach(seq => {
      const reportParam = reportParams[seq]; // 从缓存中查找对应的seq
      const eventTime = reportParam ? reportParam.event_time : new Date();

      // 缓存中超过3秒的重置
      if ((new Date().getTime() - eventTime) / 1000 > 3) {
        sendingStorage.del(seq);
      }
    });
  }
}

function setFromValueCookieFromURL() {
  const fr = getFromValueFromUrlQuery();
  if (fr) {
    setFromCookie(fr);
  }
}

// 初始化
function init(data = {}) {
  delExpirePreset();
  const presetData = getPreset();

  REPORT_DATA = {
    ...REPORT_DATA,
    ...REPORT_DEFAULT_DATA,
    ...presetData,
    ...data,
    env: getFromValueFromEnv(),
    from_source: getFromValue(),
  };
  bindEvents();
  resetReporting();
  setFromValueCookieFromURL();
  addEvent(window, 'hashchange', setFromValueCookieFromURL, false);
}

function config(data = {}) {
  REPORT_DATA = {
    ...REPORT_DATA,
    ...data,
    env: getFromValueFromEnv(),
    from_source: getFromValue(),
  };
}

const tdwReport = {
  init,
  config,
  report,
  preset,
  addShareFlag,
  bindExposePage,
  bindExposeDom,
  addFromToURLAndCookie,
  getFromValueFromEnv,
  getFromValue,
  getFromSource: getFromValue,
  getFromValueFromUrlQuery,
};

if (isClient) {
  window.GE_REPORT = window.GE_REPORT || tdwReport;
  window.tdwReport = tdwReport;
}

